import React from "react";
import {Link} from "react-router-dom";
import "./Navigation.css";

function Navigaton(){
    return (<div className="nav">
        <Link to="/">Home</Link>
        <Link 
        to={{
            pathname:"./about",
            state:{
                fromNavigation:true
            }
        }}>About</Link>
    </div>);

}
export default Navigaton;
